export function createNodeHandlers(initialNodes) {
  let nodes = structuredClone(initialNodes);
  let listener = null;

  const setNodes = async (updaterOrNodes) => {
    let newNodes;
    if (typeof updaterOrNodes === 'function') {
      newNodes = updaterOrNodes(nodes);
    } else {
      newNodes = updaterOrNodes;
    }
    nodes = structuredClone(newNodes);
    if (listener) {
      const result = listener(nodes);
      if (result instanceof Promise) {
        await result;
      }
    }
  };

  const onNodesChange = (cb) => {
    listener = cb;
  };

  return { onNodesChange, setNodes };
}

export function createNodeHandlers(initialNodes) {
  let nodes = initialNodes;

  const setNodes = (newNodes) => {
    nodes = newNodes;
  };

  const onNodesChange = (changes) => {
    setNodes(applyNodeChanges(changes, nodes));
  };

  return { onNodesChange, setNodes };
}

